import React, { Component } from "react";

class File extends Component {
  hello(name) {
    return (
      <span>
        hello {this.props.name} {this.props.name2}
      </span>
    );
  }

  render() {
    // const names ="ayman"
    const h = this.hello();

    return <h1>{h}</h1>;
  }
}

export default File;
